import React from "react";
import './App.css';
import {BrowserRouter as Router} from 'react-router-dom'

import Home from './pages/index.js';
import Members from './pages/Members.js';

function App() {
  return (
    <Router>
      <Home />
      <Members />
    </Router>
  );
}

export default App;
